/* Definitions of local (private) constants ----------------------------------*/

#define	POS_NOT_FOUND	0xFFFFFFFFU

/* Definitions of static global (private) variables --------------------------*/

/* Declarations of local (private) functions ---------------------------------*/

#define DATA_REFERENCIES_SIZE (sizeof(DataReferencies) / sizeof(DataReferencies[0]))

static size_t DD_Ref_Get_Index(const uint32_t hash_code);

/* Definitions of global (public) functions ----------------------------------*/

uint32_t DD_Get_Data_Address(uint32_t hash_code)
{
	const size_t pos = DD_Ref_Get_Index(hash_code);
	if (pos == POS_NOT_FOUND)
	{
		return NULL;
	}

	return (uint32_t) DataReferencies[pos].data_ptr;
}

int DD_Get_Hash_From_String(const char* value, const int length)
{
	int num1 = 352654597;
	int num2 = num1;
	
	for (int i = 0; i < length; i++)
	{
		num1 = (num1 << 5) + num1 + (num1 >> 27) ^ 33;
		if (length > 2)
			num2 = (num2 << 5) + num2 + (num2 >> 27) ^ value[i];
		else
			break;
	}
	
	return num1 + num2 * 1566083941;
}

dd_reference *DD_Ref_GetByUUID(const uint32_t hash_code, const char *uuid)
{
	size_t index = DD_Ref_Get_Index(hash_code);
 
	if (index == POS_NOT_FOUND)
	{
		return NULL;
	}

	// find first element with this hash
	while ((index > 0) && (DataReferencies[index-1].hash_code == hash_code))
	{
			index--;
	}

	do
	{
		if (!strcmp(DataReferencies[index].uuid, uuid))
			return &DataReferencies[index];

		index++;

	} while ((index < DATA_REFERENCIES_SIZE) && (hash_code == DataReferencies[index].hash_code));

	return NULL;
}

/* Definitions of local (private) functions ----------------------------------*/

static size_t DD_Ref_Get_Index(const uint32_t hash_code)
{
	size_t first = 0U;
	size_t last = DATA_REFERENCIES_SIZE - 1;

	while (first<last)
	{
		size_t mid = first + ((last - first) / 2);

		if (hash_code <= DataReferencies[mid].hash_code)
		{
			last = mid;
		}
		else
		{
			first = mid + 1U;
		}

	}

	if ((last < DATA_REFERENCIES_SIZE) && (hash_code == DataReferencies[last].hash_code))
	{
		return last;
	}
	else
	{
		return POS_NOT_FOUND;
	}
}

